INSERT INTO `deposits` VALUES (1,2,12,'Virtual Account Bca',500000,500000,NULL,'Pending','127.0.0.1','2022-04-07 22:37:37','2022-04-07 22:37:37',NULL,NULL,NULL),(2,2,12,'Virtual Account Bca',500000,500000,NULL,'Pending','127.0.0.1','2022-04-07 22:47:57','2022-04-07 22:47:57',NULL,'[{\"title\":\"Internet Banking\",\"steps\":[\"Login ke internet banking klikbca Anda\",\"Pilih menu <b>Transfer Dana<\\/b> lalu pilih <b>Transfer ke BCA Virtual Account<\\/b>\",\"Pilih <b>Dari Rekening<\\/b>\",\"Masukkan Nomor VA (<b>140932122760<\\/b>) lalu klik <b>Lanjutkan<\\/b>\",\"Detail transaksi akan ditampilkan, pastikan data sudah sesuai lalu masukkan respon <b>Key BCA Appli 1<\\/b>\",\"Klik <b>Kirim<\\/b>\",\"Transaksi sukses, simpan bukti transaksi Anda\"]},{\"title\":\"Mobile Banking\",\"steps\":[\"Login pada aplikasi BCA mobile\",\"Pilih <b>m-BCA<\\/b> masukkan kode akses m-BCA\",\"Pilih <b>m-Transfer<\\/b>\",\"Pilih <b>BCA Virtual Account<\\/b>\",\"Masukkan Nomor VA (<b>140932122760<\\/b>) lalu klik <b>OK<\\/b>\",\"Konfirmasi no virtual account dan rekening pendebetan\",\"Periksa kembalian rincian pembayaran anda, lalu klik <b>Ya<\\/b>\",\"Masukkan pin m-BCA\",\"Pembayaran Selesai\"]},{\"title\":\"ATM BCA\",\"steps\":[\"Masukkan kartu ATM BCA & PIN\",\"Pilih menu <b>Transaksi Lainnya > Transfer > Ke Rekening BCA Virtual Account<\\/b>\",\"Masukkan Nomor VA (<b>140932122760<\\/b>)\",\"Di halaman konfirmasi, pastikan detail pembayaran sudah sesuai seperti Nomor VA, Nama, Produk dan Total Tagihan\",\"Jika sudah benar, klik <b>Ya<\\/b>\",\"Simpan struk transaksi sebagai bukti pembayaran\"]}]','140932122760'),(3,2,16,'Gopay',200000,1400000,NULL,'Pending','127.0.0.1','2022-04-07 23:04:51','2022-04-07 23:04:51','https://tripay.co.id/qr/T107012122850WHOSH','[{\"title\":\"Pembayaran via QRIS\",\"steps\":[\"Masuk ke aplikasi dompet digital Anda yang telah mendukung QRIS\",\"Pindai\\/Scan QR Code yang tersedia\",\"Akan muncul detail transaksi. Pastikan data transaksi sudah sesuai\",\"Selesaikan proses pembayaran Anda\",\"Transaksi selesai. Simpan bukti pembayaran Anda\"]},{\"title\":\"Pembayaran via QRIS (Mobile)\",\"steps\":[\"Download QR Code pada invoice\",\"Masuk ke aplikasi dompet digital Anda yang telah mendukung QRIS\",\"Upload QR Code yang telah di download tadi\",\"Akan muncul detail transaksi. Pastikan data transaksi sudah sesuai\",\"Selesaikan proses pembayaran Anda\",\"Transaksi selesai. Simpan bukti pembayaran Anda\"]}]',NULL),(4,1,12,'Virtual Account Bca',500000,500000,NULL,'Pending','127.0.0.1','2022-04-07 23:16:05','2022-04-07 23:16:05',NULL,'[{\"title\":\"Internet Banking\",\"steps\":[\"Login ke internet banking klikbca Anda\",\"Pilih menu <b>Transfer Dana<\\/b> lalu pilih <b>Transfer ke BCA Virtual Account<\\/b>\",\"Pilih <b>Dari Rekening<\\/b>\",\"Masukkan Nomor VA (<b>140932122905<\\/b>) lalu klik <b>Lanjutkan<\\/b>\",\"Detail transaksi akan ditampilkan, pastikan data sudah sesuai lalu masukkan respon <b>Key BCA Appli 1<\\/b>\",\"Klik <b>Kirim<\\/b>\",\"Transaksi sukses, simpan bukti transaksi Anda\"]},{\"title\":\"Mobile Banking\",\"steps\":[\"Login pada aplikasi BCA mobile\",\"Pilih <b>m-BCA<\\/b> masukkan kode akses m-BCA\",\"Pilih <b>m-Transfer<\\/b>\",\"Pilih <b>BCA Virtual Account<\\/b>\",\"Masukkan Nomor VA (<b>140932122905<\\/b>) lalu klik <b>OK<\\/b>\",\"Konfirmasi no virtual account dan rekening pendebetan\",\"Periksa kembalian rincian pembayaran anda, lalu klik <b>Ya<\\/b>\",\"Masukkan pin m-BCA\",\"Pembayaran Selesai\"]},{\"title\":\"ATM BCA\",\"steps\":[\"Masukkan kartu ATM BCA & PIN\",\"Pilih menu <b>Transaksi Lainnya > Transfer > Ke Rekening BCA Virtual Account<\\/b>\",\"Masukkan Nomor VA (<b>140932122905<\\/b>)\",\"Di halaman konfirmasi, pastikan detail pembayaran sudah sesuai seperti Nomor VA, Nama, Produk dan Total Tagihan\",\"Jika sudah benar, klik <b>Ya<\\/b>\",\"Simpan struk transaksi sebagai bukti pembayaran\"]}]','140932122905'),(5,1,16,'Gopay',100000,700000,NULL,'Canceled','127.0.0.1','2022-04-19 08:28:32